import React from "react";

const List= (props) => {
    return (
    <>
        <div className="list">
        <i className="fa fa-times" aria-hidden="true" onClick={() =>{
            props.onse
        }}></i>
            <li>{props.text}</li>
        </div>
    </>
    )
}

export default List;
